import React, { Component } from 'react';
import './App.css';
import './styles/style.css';
import About from './components/about';

class App extends Component {
  render() {
    return (
      /* navigation */
<>
    <nav role="navigation" class="navigation-menu w-nav-menu">
      <div class="row w-row">
        <div class="column-4 w-col w-col-6">
          <h1 class="heading-4 large"><a href="/" data-ix="opacity-on-hover" aria-current="page" class="link-7 w--current" style="opacity: 1; transform: translateX(0px) translateY(0px) translateZ(0px);">Brandon Jernigan</a></h1>
          <p class="paragraph-4">UX designer</p>
        </div>
        <div class="column-5 w-col w-col-3">
          <h1 class="heading-4">Menu —</h1><a href="/" data-ix="opacity-on-hover" aria-current="page" class="navigation-link white w-nav-link w--current" style="opacity: 1; transform: translateX(0px) translateY(0px) translateZ(0px);">Home</a><a
            href="/about" data-ix="opacity-on-hover" class="navigation-link white w-nav-link" style="opacity: 1; transform: translateX(0px) translateY(0px) translateZ(0px);">About</a><a data-ix="opacity-on-hover"
            href="" class="navigation-link white w-nav-link" style="opacity: 1; transform: translateX(0px) translateY(0px) translateZ(0px);">Get in touch</a>
        </div>
        <div class="column-25 w-col w-col-3">
          <h1 class="heading-4">Work —</h1><a href="/universe-dashboard" data-ix="opacity-on-hover" class="navigation-link white w-nav-link" style="opacity: 1; transform: translateX(0px) translateY(0px) translateZ(0px);">Universe Dashboard</a><a
            href="/routr" data-ix="opacity-on-hover" class="navigation-link white w-nav-link" style="opacity: 1; transform: translateX(0px) translateY(0px) translateZ(0px);">Routr</a><a href="/ticket-manager" data-ix="opacity-on-hover"
            class="navigation-link white w-nav-link" style="opacity: 1; transform: translateX(0px) translateY(0px) translateZ(0px);">Ticket Manager</a><a href="/side-projects" data-ix="opacity-on-hover" class="navigation-link white w-nav-link"
            style="opacity: 1; transform: translateX(0px) translateY(0px) translateZ(0px);">Side Projects</a>
        </div>
      </div>
    </nav>
    /* hero */
    <section class="hero-section">
        <div class="title-wrapper">
          <h1 class="main-h1">Brandon Jernigan</h1>
          <h2 class="label-h2">UX designer</h2>
        </div>
        <div class="title-image">
        </div>
    </section>
</>
    );
  }
}

export default App;
